import './App.css';
import About from './Pages/About/About';
import bikuImage from './Images/dibya.jpg';
import sanskarImage from './Images/sanskar.jpg';
import nakinaImage from './Images/nakina.jpg';
import arjyaImage from './Images/arjya.jpg';
import somuImage from './Images/somu.jpg';

function App() {
  return (
    <div className="App">
      
      <h1>About Us</h1>
      <p>Our team is a very good team. Where we focus on unity.And at last i want to say thet masallah Boys played well.</p>
      <div className='s_AppCard'>
      <About
          name="Dibya Ranjan Rath"
          image={bikuImage}
          des="Hello, I am a 3rd year B-Tech student in CSE branch of Silicon Institute Of Technology, Bhubaneswar. Sic-20BCSE62"
          />
          
        <About
          name="Sanskar Mohanty"
          image={sanskarImage}
          des="Hello, I am a 3rd year B-Tech student in CSE branch of Silicon Institute Of Technology, Bhubaneswar. Sic-20BCSE46"
        />
        <About
          name="Nakina Baba Sai"
          image={nakinaImage}
          des="Hello, I am a 3rd year B-Tech student in CSE branch of Silicon Institute Of Technology, Bhubaneswar. Sic-20BCEE09"
        />
       <About
          name="Arjyabrat"
          image={arjyaImage}
          des="Hello, I am a 3rd year B-Tech student in CSE branch of Silicon Institute Of Technology, Bhubaneswar. Sic-20BCSE66"
        />
         <About
          name="Soumendra pradhan"
          image={somuImage}
          des="Hello, I am a 3rd year B-Tech student in CSE branch of Silicon Institute Of Technology, Bhubaneswar. Sic-21BCSL08"
        />
        
      </div>
    </div>
  );
}

export default App;
